import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, useParams } from 'react-router-dom';
import Register from './auth/Register';
import Login from './auth/Login';
import Adminlogin from './auth/Adminlogin';
import Adminregistration from './Components/Adminregistration';
import Superadmin from './auth/Superadmin';
import Dashboard from './Dashboard';
import Newgrievance from './Newgrievance';
import Adminmaster from './Adminmaster';
import View from './View';
import Complaint from './Components/Complaint';
import Home from './Home';
import Dashboardsuperadmin from './Dashboardsuperadmin';
import Manageusers from './Manageusers';
import Footer from './Footer/Footer';
import Navbar from './Navbar/Navbar';
import Sidebar from './Sidebar/sidebar.jsx';

function App() {
  const [image, setImage] = useState(null);
  const [userRole, setUserRole] = useState('');

  const handle = (name) => {
    setImage(name);
    console.log(name);
  };

  const params = useParams();

  useEffect(() => {
    console.log("Params ID:", params.id);
    if (['create-admin', 'superadmin', 'dashboards-a', 'manage-users'].includes(params.id)) {
      setUserRole('superadmin');
    } else {
      setUserRole('user');
    }
  }, [params]);

  const { match } = this.props;
    const { id } = match.params;

  const [showSidebar, setShowSidebar] = useState(false);

  const toggleSidebar = () => {
    setShowSidebar(!showSidebar);
  };

  return (
    <>
      <div className="area">
        <ul className="circles">
          <li></li>
          <li></li>
          <li></li>
          <li></li>
          <li></li>
          <li></li>
          <li></li>
          <li></li>
          <li></li>
          <li></li>
        </ul>

        <div className="context">
          <Router>
            <Navbar toggleSidebar={toggleSidebar}/>
            <Sidebar showSidebar={showSidebar} toggleSidebar={toggleSidebar}  userRole={userRole} />
            <Routes>
              <Route path='/' element={<Home />} />
              <Route path='/user/history' element={<Dashboard />} />
              <Route path='/user/new' element={<Newgrievance />} />
              <Route path='/superadmin/complaint/1' element={<Complaint handle_view={handle} />} />
              <Route path='/admin/complaint' element={<Complaint handle_view={handle} />} />
              <Route path='/superadmin/create-admin/1' element={<Adminregistration />} />
              <Route path='/superadmin/1' element={<Adminmaster handle_view={handle} />} />
              <Route path='/superadmin/dashboards-a/1' element={<Dashboardsuperadmin />} />
              <Route path='/superadmin/manage-users/1' element={<Manageusers />} />
              <Route path="/image" element={<View image={image} />} />
            </Routes>
            <Footer />
          </Router>
        </div>

        <Router>
          <Routes>
            <Route path='/superadminlogin' element={<Superadmin />} />
            <Route path='/adminlogin' element={<Adminlogin />} />
            <Route path="/register" element={<Register />} />
            <Route path="/login" element={<Login />} />
          </Routes>
        </Router>
      </div>
    </>
  );
}

export default App;
